Text: this happened several years ago. i had a friend "jack" (more like an acquaintance) who got married several years ago. i attended the wedding in houston and all was good. i had moved to chicago shortly after and didn't really keep in touch. about 2 years later, i was in houston over the holidays and ran into him at a family holiday party. the conversation went like this:

&nbsp;

"hey jack, it's been a long time! how are you doing?! how's married life treating you?"

&nbsp;

"i got divorced."

&nbsp;

"oh."  (fml, awkwardness ensues). feeling like a jackass, i apologized and did my best to end the conversation quickly.
